color: white;
display: flex;
height: 80vh;
-webkit-text-stroke-width: 1px;
    -webkit-text-stroke-color: #000;  // style-font
  
    
`


export const Sobre = ()=> {
    return(
        <Container >
            <div className="part1">
                <div className="body-sobre">
                    <h1>Sobre mim</h1><br></br>
                    <h3>Meu nome é Igor Barbosa dos Santos, nasci em São Roque no estado de São Paulo.<br/>
                    quando mais novo sempre fui próximo com a tecnologia, como jogos e vídeos.Estudei vários<br/>
                    cursos de Informática é até manutenção de computadores é .


                    
                    </h3>


                </div>
            </div>
            <div className="part2"></div>
        </Container>
    )
}
